import React from "react";

function Body() {
  return (
    <div className="bod">
      <del className="mem">Memorize</del>
      <br />
      Save It!
      <br />
      <p className="mm">
        Use BookNotes to save your selected text etc,
        <br />
        so you dont have to remember anything.
      </p>
      <a href="/new"></a>
    </div>
  );
}

export default Body;
